import Qs from "qs";
import { getTimeDate } from "@/utils/index.js";
export default {
  name: "orderinfo",
  components: {},
  props: {
    isShowDialog: Boolean,
    selectItem: {
      type: Object
    }
  },
  watch: {
    selectItem: function selectItem(newValue, oldValue) {
      this.orderinfo = newValue;
      this.orderinfo.dbCreateSysTime = this.formatTime(this.orderinfo.dbCreateSysTime);
      this.form = this.orderinfo;
      if (this.form.payFileId) this.getFilesUrl(this.form.payFileId);
    }
  },
  data: function data() {
    return {
      fileurl: "",
      form: {}
    };
  },
  computed: {},
  created: function created() {},
  mounted: function mounted() {},
  methods: {
    formatTime: function formatTime(cellValue) {
      return getTimeDate(cellValue);
    },
    //获取付款凭证
    getFilesUrl: function getFilesUrl(item) {
      var _this = this;

      this.axios.get(this.urls.getFileurl + "?id=" + item).then(function (response) {
        if (response.code == 0) return _this.$message.error(response.msg);
        _this.fileurl = _this.urls.imgbaseurl + response.data.substring(2, response.data.length);
      });
    },
    //dialog关闭按钮
    handleClose: function handleClose() {
      // this.isNewDialog = false;
      this.$emit("editDialog", false);
    }
  }
};
